function Jumbotron () {
  return (
    <div className='jumbotron'>
      <h1> Welcome to Game Meet!</h1>
      <p>
				Please select the choice of either logging in or creating an acoount. After you have completed these
				actions you will be shown listings of meetup groups for games in a specific area.
      </p>
    </div>
  )
}

export default Jumbotron
